import React from 'react';
import { TouchableOpacity, Text, StyleSheet } from 'react-native';
import { useNavigation } from '@react-navigation/native';

export default function BackIcon() {
  const navigation = useNavigation();

  const handleBackPress = () => {
    navigation.navigate('Dashboard'); // Replace 'Dashboard' with the actual name of your dashboard screen
  };

  return (
    <TouchableOpacity style={styles.backIconContainer} onPress={handleBackPress}>
      <Text style={styles.backIcon}>‚Üê</Text>
    </TouchableOpacity>
  );
}

const styles = StyleSheet.create({
  backIconContainer: {
    position: 'absolute',
    top: 20,
    left: 20, // You may adjust the position as needed
    backgroundColor: 'transparent',
  },
  backIcon: {
    fontSize: 24,
  },
});
